  // });
  // console.log(items); 



  return (
    <>
      <center><h1>Todo List</h1></center>
      <div style={{'display': 'flex'}}>
        <div style={{'display': 'inline'}} >
          <input type='text' />
          <button style={{'marginLeft': '1rem', }} name='Add'>Add</button>
        </div>

          <ul>
          {
            data.map((item,i) => {
              return <li>{item.name}</li>
            })
          }
          </ul>
      </div>
    </>
  );
}

export default App;
